import React, {Component} from "react/cjs/react.production.min";


class Navbar extends Component {


    constructor(props) {
        super(props);
        this.state = {
            loginedUser: false

        };
    }

    render() {
        return (
            <nav className="navbar navbar-light bg-light">
                <a className="navbar-brand" href="#">Navbar</a>
            </nav>
        );
    }

}

export default Navbar;
